    private $body2 = '<p>One of a kind fly fishing on Idaho\'s wild Salmon River.</p><p><img src="data:image/jpeg;base64,"></p><p><strong>In the world of fly fishing "swinging" flies for steelhead using two-handed spey rods has become the norm</strong> for many fly fishers. Spey rod fly anglers have developed their own&nbsp;lingo and use this language to size up the rest of&nbsp;the fly fishing world.</p><p>Each year more of these spey-rod-obsessed fly fishing characters can be found sprawling across their favorite run, swinging for the chance at glory that to them only a&nbsp;Pacific-run steelhead can bring. This hardcore culture of <em>steelheaders</em> has brought with it new angling pressure to many of our favorite&nbsp;northwestern steelhead rivers.</p><p><img src="data:image/jpeg;base64,"></p><p><strong>Idaho\'s Salmon River is the heart of the</strong> <strong>largest wilderness area in the continental United States</strong>. Backcountry River Guides is exclusively licensed to offer unique expeditions covering two-hundred miles (120 of it being roadless ) of water in the Frank Church River of No Return Wilderness Area. Much of the water Backcountry River Guides has access to has never seen a spey rod, offering a truly pioneering experience for any enthusiast searching for that magic steel!</p><p>This fishery has a short peak each year. The water temps and river flows are historically best from&nbsp;<strong>October 15th - Nov 15th</strong>,&nbsp;so Brent Sawyer typically only books for this trip well in advance of this short window.</p><p><img src="data:image/jpeg;base64,"></p><p>The BRG trips offered by Hobo Fly Fishing are part of our "Full Service" lineup and we highly recommend it to any steelhead spey-caster chasing the trip-of-a-lifetime on a budget.</p><p><strong>Our recommended trip</strong>, to best enjoy this remote setting, <strong>is 3 days and 3 nights of fishing for 3-4 people.</strong></p><p>Wading in Idaho\'s wild salmon river for hours each day can be taxing on the body, and after those long days in the river casting and swinging flies you  may want more, but your body and your weathered soul might thank us for suggesting three, not four days.</p><ul><li>You will be provided lodging in top-notch heated wall tents.</li><li>Breakfast, Lunch, and Dinner each day</li><li>Shuttle by jet boat to many runs devoid of anglers, throughout the trip.</li></ul><p>We personally can\'t offer a better steelhead-on-the-fly opportunity at this price, or in such a remote setting&nbsp;in the lower 48, than with Brent Sawyer and Backcountry River Guides.&nbsp;</p><p><img src="data:image/jpeg;base64,"></p><blockquote><strong>Multi-Day Trips</strong></blockquote><p>Multi days lodge stays are a great way to truly experience the heart of the backcountry.&nbsp;&nbsp;Utilizing one of the backcountry ranches in the wilderness, multi-day trips are able to fish water that is not realistic on day trips due to the remoteness and commute times.&nbsp;&nbsp;For the 2016/2017 fishing season we will be offering deluxe wall tent camps in remote locations for a great getaway.</p><p>$250 per fisherman per day, $600 boat minimum, 6 fisherman Max + lodge fees (contact us for details and availability).</p><blockquote><strong>Day Trips</strong></blockquote><p>These will begin at 8:00 AM at a designated ramp and conclude at that same ramp about 5:00 PM.&nbsp;&nbsp;Day trips include lunch, snacks, hot and cold beverages.&nbsp;&nbsp;Guests will meet their guide at the ramp.</p><p><em>$250 per fisherman, $600 boat minimum, 6 fisherman max.</em></p><blockquote><strong>What to Bring</strong></blockquote><p>Idaho weather during steelhead season can be unpredictable, so come prepared!&nbsp;&nbsp;We recommend plenty of warm clothing (in layers), stocking hat, ball cap, gloves, good rain gear and sunglasses.&nbsp;Our boats all have propane heaters but it is no substitute for proper clothing.&nbsp;&nbsp;You will need an Idaho fishing license and a steelhead tag.</p>';
    private $body = "<p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>It has been said that a picture paints a thousand words. I disagree.</p><p>This photo was taken by my good friend&nbsp;Roger in Chetumal bay, near the border of Belize. To me it is the epitome of do it yourself fly fishing in a foreign land. We had just waded about 3 miles to a saltwater flat that was, to us, uncharted, in search of bonefish, permit, tarpon and barracuda. It was indeed a Lewis and Clark moment. Roger had an exceptional morning sight-casting to bonefish. On this morning he had the hot hand. I was in marginal shape in both mind and body following the previous night's dinner of tequila and popcorn; a dinner that I will avoid in the future. The prelude to our wading trek was an hour long drive on a really bad Mexican&nbsp;backcountry road leaving from a town of 300 inhabitants. This road passed thru a desolate, weathered&nbsp;tropical landscape.</p><p>We reached a single dwelling that was sporting a Mexican flag high above. At first glance we thought it might be a military camp but a shirtless young man in his late twenties or early thirties appeared from the dwelling. The road was blocked with a chain and padlock and I was in no mood to push our luck. Roger hopped out of our car and walked to the chained post without discussion and pulled the chain off the post and said we were going to continue towards the dwelling and park. Reluctantly I followed his lead. In broken Spanish we greeted the young man and told him we were fishing and asked if it was ok if we parked there. He seemed friendly enough and pointed to where he wanted us to park the vehicle.&nbsp;We grabbed our gear and headed to a lagoon.</p><p>The water was a bit murky and the depth was hard to judge. It was my turn to get even with Roger for making me nervous about the recent intrusion. I started wading across the lagoon without hesitation, knowing it was&nbsp;a 50/50 chance of getting to the other side and into the flats of the bay. Roger reluctantly followed.&nbsp;After an ankle-to-chest-deep wade thru mud and water we reached the bay. Roger picked off nice bonefish within the first 25 yards of fishing. We both continued down the shoreline for about a mile of fun catching bonefish and 'cudas. We reached a big point protruding from the mangroves forming a bay within the bay. Across the bay facing east was a point about 2 miles away. The flat that connected those two points looked fishy. This was my chance to get two eyes for an eye and really get even with Roger for making me nervous at the gate. Before entering the water I noticed some wakes (fish swimming) at 12 o'clock, a hundred yards away, heading right at me. I had a great shot at a band of Permit swimming at me and around the point, but was simply unable to connect. For me, personally, all Permit encounters are surreal and I will take every one of them to my grave. After this failed and humbling permit encounter, that I blame on tequila and popcorn, I waded back across the 2 mile flat with Roger in tow. When we reached the far point we shared our last bottle of water, took a few photos of the incredible saltwater surroundings, and all I could think to myself was a single silent word; \"Wow.\"</p>";
